// frontend/src/components/GifPicker.js
import React, { useState, useEffect } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  TextField,
  Grid,
  Box,
  IconButton,
  CircularProgress,
  Typography
} from '@mui/material';
import { Close as CloseIcon, Search as SearchIcon } from '@mui/icons-material';

const GifPicker = ({ open, onClose, onSelect }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [gifs, setGifs] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleGifSelect = (gif) => {
    // Make sure we're accessing the correct URL property
    const gifUrl = gif.media_formats?.gif?.url || gif.url;
    if (!gifUrl) {
      console.error('No valid URL found in GIF data:', gif);
      return;
    }
    onSelect({ ...gif, url: gifUrl });
  };

// frontend/src/components/GifPicker.js
// Update the fetchGifs function:

  const fetchGifs = async (query) => {
    setLoading(true);
    setError(null);
    try {
      console.log('Fetching GIFs...', query ? 'Search query: ' + query : 'Trending');

      // Add the full backend URL
      const baseUrl = 'http://localhost:3001';
      const endpoint = query 
        ? `${baseUrl}/api/gifs/search?q=${encodeURIComponent(query)}`
        : `${baseUrl}/api/gifs/trending`;

      console.log('Requesting endpoint:', endpoint);

      const response = await fetch(endpoint, {
        method: 'GET',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json'
        }
      });

      console.log('Response status:', response.status);

      if (!response.ok) {
        throw new Error('Failed to fetch GIFs');
      }

      const data = await response.json();
      console.log('Received GIFs:', data);
      setGifs(data);
    } catch (err) {
      console.error('GIF fetch error:', err);
      setError('Failed to load GIFs');
    } finally {
      setLoading(false);
    }
  };

    useEffect(() => {
      if (open) {
        fetchGifs('');  // Load trending GIFs when opened
      }
    }, [open]);

    const handleSearch = (e) => {
      e.preventDefault();
      if (searchTerm.trim()) {
        fetchGifs(searchTerm);
      }
    };

  return (
    <Dialog 
      open={open} 
      onClose={onClose}
      maxWidth="md"
      fullWidth
    >
      <DialogTitle>
        <Box display="flex" alignItems="center" justifyContent="space-between">
          <Typography>Select a GIF</Typography>
          <IconButton onClick={onClose} size="small">
            <CloseIcon />
          </IconButton>
        </Box>
      </DialogTitle>

      <DialogContent>
        <Box component="form" onSubmit={handleSearch} sx={{ mb: 2 }}>
          <TextField
            fullWidth
            placeholder="Search GIFs..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
            InputProps={{
              endAdornment: (
                <IconButton type="submit">
                  <SearchIcon />
                </IconButton>
              )
            }}
          />
        </Box>

        {loading ? (
          <Box display="flex" justifyContent="center" p={3}>
            <CircularProgress />
          </Box>
        ) : error ? (
          <Typography color="error" align="center">{error}</Typography>
        ) : (
          <Grid container spacing={2}>
            {gifs.map((gif, index) => (
              <Grid item xs={6} sm={4} md={3} key={index}>
                <Box 
                  component="img"
                  src={gif.media_formats?.tinygif?.url || gif.media_formats?.gif?.url}
                  alt={gif.content_description || 'GIF'}
                  sx={{
                    width: '100%',
                    height: 'auto',
                    cursor: 'pointer',
                    borderRadius: 1,
                    '&:hover': {
                      opacity: 0.8
                    }
                  }}
                  onClick={() => {
                    handleGifSelect(gif);
                    onClose();
                  }}
                  onError={(e) => {
                    console.error('Failed to load GIF:', gif);
                    e.target.style.display = 'none';
                  }}
                />
              </Grid>
            ))}
          </Grid>
        )}
      </DialogContent>
    </Dialog>
  );
};

export default GifPicker;
